def comment_tag(d, n):
    v = d.args[n].value
    if v >= 10:
        d.args[n].print += f' ( {v - 10})'


def comment(d, n, desc):
    v = d.args[n].value
    if v in desc:
        d.args[n].print += f' ({desc[v]})'


def comment_tag0(d):
    comment_tag(d, 0)


def comment_tag1(d):
    comment_tag(d, 1)


def comment_ev0(d):
    comment(d, 0, event_desc)


def comment_ev1(d):
    comment(d, 1, event_desc)


def comment_cmd0(d):
    comment(d, 0, cmd_desc)


def comment_tag0_cmd1(d):
    comment_tag(d, 0)
    comment(d, 1, cmd_desc)


def comment_cmd2_ev3(d):
    comment(d, 2, cmd_desc)
    comment(d, 3, event_desc)


def comment_rem0(d):
    comment(d, 0, cmd_rem)
